import React from "react"
import { Route, Routes } from "react-router-dom";


const Modal = ({setPullId, pullId, setModal, tableData, CarsM, PullsM}) => {

   return(  
      <Routes>
      <Route element={<CarsM setPullId={setPullId} {...{pullId, setModal, tableData}}/>} />
      <Route  element={<PullsM setPullId={setPullId} {...{pullId, setModal, tableData}}/>} />
      </Routes>
   )
}

export default Modal;
